function TableCheckbox({value, onChange}) {
  const onInputChange = (event) => {
    onChange(event.target.checked)
  }

  return(
    <input type="checkbox" value={value} onChange={onInputChange}/>
  );
}

TableCheckbox.defaultProps = {
  value: false,
  onChange: () => {}
}

export default TableCheckbox;
